import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Provider } from 'react-redux';
import { store } from './store';
import Layout from './components/common/Layout';
import Login from './components/auth/Login';
import JobsBoard from './components/jobs/JobsBoard';
import JobDetail from './components/jobs/JobDetail';
import CandidatesList from './components/candidates/CandidatesList';
import CandidateProfile from './components/candidates/CandidateProfile';
import AssessmentBuilder from './components/assessments/AssessmentBuilder';
import AssessmentForm from './components/assessments/AssessmentForm';
import CandidateJobsBoard from './components/candidates/JobsBoard';
import JobApplication from './components/candidates/JobApplication';
import ApplicationSuccess from './components/candidates/ApplicationSuccess';
import CandidateDashboard from './components/candidates/CandidateDashboard';
import { useAppSelector } from './hooks/redux';


const ProtectedRoute: React.FC<{ children: React.ReactNode }> = ({ children }) => {
  const { isAuthenticated } = useAppSelector((state) => state.auth);
  return isAuthenticated ? <>{children}</> : <Navigate to="/login" />;
};

const AppRoutes: React.FC = () => {
  const { user } = useAppSelector((state) => state.auth);

  return (
    <Routes>
      <Route path="/login" element={<Login />} />
      
      {/* HR Routes */}
      {user?.role === 'hr' && (
        <Route path="/" element={
          <ProtectedRoute>
            <Layout>
              <JobsBoard />
            </Layout>
          </ProtectedRoute>
        } />
      )}

      {/* Candidate Routes */}
      {user?.role === 'candidate' && (
        <Route path="/" element={
          <ProtectedRoute>
            <Layout>
              <CandidateDashboard />
            </Layout>
          </ProtectedRoute>
        } />
      )}

      {/* Common HR Routes */}
      <Route path="/jobs" element={
        <ProtectedRoute>
          <Layout>
            <JobsBoard />
          </Layout>
        </ProtectedRoute>
      } />
      
      <Route path="/jobs/:jobId" element={
        <ProtectedRoute>
          <Layout>
            <JobDetail />
          </Layout>
        </ProtectedRoute>
      } />
      
      <Route path="/candidates" element={
        <ProtectedRoute>
          <Layout>
            <CandidatesList />
          </Layout>
        </ProtectedRoute>
      } />
      
      <Route path="/candidates/:candidateId" element={
        <ProtectedRoute>
          <Layout>
            <CandidateProfile />
          </Layout>
        </ProtectedRoute>
      } />
      
      <Route path="/assessments/:jobId" element={
        <ProtectedRoute>
          <Layout>
            <AssessmentBuilder />
          </Layout>
        </ProtectedRoute>
      } />

      {/* Common Candidate Routes */}
      <Route path="/candidate-dashboard" element={
        <ProtectedRoute>
          <Layout>
            <CandidateDashboard />
          </Layout>
        </ProtectedRoute>
      } />
      
      <Route path="/browse-jobs" element={
        <ProtectedRoute>
          <Layout>
            <CandidateJobsBoard />
          </Layout>
        </ProtectedRoute>
      } />
      
      <Route path="/application/:jobId" element={
        <ProtectedRoute>
          <Layout>
            <JobApplication />
          </Layout>
        </ProtectedRoute>
      } />
      
      <Route path="/application/success" element={
        <ProtectedRoute>
          <Layout>
            <ApplicationSuccess />
          </Layout>
        </ProtectedRoute>
      } />
      
      <Route path="/assessment/:jobId" element={
        <ProtectedRoute>
          <Layout>
            <AssessmentForm />
          </Layout>
        </ProtectedRoute>
      } />

      {/* Fallback route - redirect based on role */}
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
};

const App: React.FC = () => {
  return (
    <Provider store={store}>
      <Router>
        <div className="min-h-screen bg-gray-50">
          <AppRoutes />
        </div>
      </Router>
    </Provider>
  );
};

export default App;
